import React from 'react';
import VideoCard from './VideoCard';

const VideoList = ({ videos }) => {
    const videoThumbnails = videos.map(video => {
        return <VideoCard video={video} />
    })
    
    return <div>{videoThumbnails}</div>
}

export default VideoList;
